// import library
import { Link } from 'react-router-dom'

// import image
import logo from '../../assets/images/SUNRISE.png'

function Navbar() {
    return (
        <div className="bg-white">
            <div className="row min-navbar">
                <div className='col-2'>
                    <img src={logo} alt='logo' className='img-fluid'/>
                </div>
                <div className='col-10 d-flex align-items-center justify-content-end'>

                    <Link to='/login' className='min-navbtn'>
                        LOGIN
                    </Link>
                    <Link to='/register' className='min-navbtn'>
                        REGISTER
                    </Link>
                </div>
            </div>
        </div>
    );
}

export default Navbar;
